import Navbar from '../components/navbar'
import Name from '../components/name'
import React, { useEffect } from 'react'
import BrandStatement from '../components/brandStatement'
import WorkExperience from '../components/workExperience'
import Footer from '../components/footer'


export default function About() {

    useEffect(() => {
        document.body.style.backgroundColor = '#8ea9cc'
    }
    )
    return (
        <div>
            <Navbar />
            <div className="center">
                <Name />
                <BrandStatement />
            </div>
            <div>
                <WorkExperience />
                <Footer />
            </div>
            <div>
                <svg className="arrow" width="1em" height="1em" viewBox="0 0 16 16" class="bi bi-arrow-bar-up" fill="currentColor" xmlns="http://www.w3.org/2000/svg">
                    <path fill-rule="evenodd" d="M11.354 5.854a.5.5 0 0 0 0-.708l-3-3a.5.5 0 0 0-.708 0l-3 3a.5.5 0 1 0 .708.708L8 3.207l2.646 2.647a.5.5 0 0 0 .708 0z" />
                    <path fill-rule="evenodd" d="M8 10a.5.5 0 0 0 .5-.5V3a.5.5 0 0 0-1 0v6.5a.5.5 0 0 0 .5.5zm-4.8 1.6c0-.22.18-.4.4-.4h8.8a.4.4 0 0 1 0 .8H3.6a.4.4 0 0 1-.4-.4z" />
                </svg>
            </div>
            <style jsx>
                {`
                .center {
                    margin-top: 500px;
                },
                .arrow {
                    color: #d7e1ed;
                    height: 20px;
                    width: 20px;
                    opacity: 12;

                }`}
            </style>
        </div>
    )
}
